const Work = () => {
    return (
        // eslint-disable-next-line react/react-in-jsx-scope
        <div
            style={{
                height: '100vh',
                width: '100%',
                background: 'blue',
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
            }}
        >
            Work
        </div>
    );
}

export default Work;
